import { Navbar } from 'react-bootstrap';
import {About} from 'react-bootstrap';
import {Services} from 'react-bootstrap';
import {Destination} from 'react-bootstrap';
import {Tour} from 'react-bootstrap';
import {Package} from 'react-bootstrap';
import {Booking} from 'react-bootstrap';
import {Guide} from 'react-bootstrap';
import {Blogs} from 'react-bootstrap';
import {Testimonial} from 'react-bootstrap';
import {NewsLetter} from 'react-bootstrap';
import {Footer} from 'react-bootstrap';

export default function Home(){
    return(
        <>
          <>
    <Navbar/> <br/>
    <About/>
    <Services/>
    <Destination/>
    <Tour/>
    <Package/>
    <Booking/>
    <Guide/>
    <Blogs/>
    <Testimonial/>
    <NewsLetter/>
    <Footer/>
    </>
        </>
    )
}
